import React, { useState, useEffect } from 'react';
import './style.css'

const SelectCar = () => {
  const [brand, setBrand] = useState([]);
   useEffect(() => {

  fetch(
    `models.json`,
    {
      method: "GET",

    },

  )
    .then(res => res.json())
    .then(response => {
    //  console.log(response);
       setBrand(response);
    })
    .catch(error => console.log(error));
});

	return (
		<React.Fragment>
      {/* {brand} */}
        <select>

        {brand.map((brand, index) => (
        <option
          key={index}
          value={brand.model}
        >
          {brand.model}
        </option>
      ))}

    </select>
		</React.Fragment>
	)
}

export default SelectCar;
